package DataStructures\;

import java\.util\.BitSet\;
import java\.util\.Scanner\;
/\*Sample Input

5 4
AND 1 2
SET 1 4
FLIP 2 2
OR 2 1
Sample Output

0 0
1 0
1 1
1 2
\*/
public class JavaBitSet \{
 public static void main\(String\[\] args\) \{
 Scanner sc \= new Scanner\(System\.in\)\;
 int n \= sc\.nextInt\(\)\;
 BitSet b1 \= new BitSet\(n\)\;
 BitSet b2 \= new BitSet\(n\)\;
 int m \= sc\.nextInt\(\)\;
 for \(int i \= 0\; i \< m\; i\+\+\) \{
 executeAction\(sc\.next\(\)\,sc\.nextInt\(\)\,sc\.nextInt\(\)\,b1\,b2\)\;
 \}
 \}

 private static void executeAction\(String action\, int p1\, int p2\, BitSet b1\, BitSet b2\) \{
 switch \(action\) \{
 case "AND"\:
 if \(p1\=\=1\)
 doAnd\(b1\,b2\)\;
 else
 doAnd\(b2\,b1\)\;
 break\;
 case "SET"\:
 if \(p1\=\=1\)
 doSet\(b1\,p2\)\;
 else
 doSet\(b2\,p2\)\;
 break\;
 case "FLIP"\:
 if \(p1\=\=1\)
 doFlip\(b1\,p2\)\;
 else
 doFlip\(b2\,p2\)\;
 break\;
 case "OR"\:
 if \(p1\=\=1\)
 doAnd\(b1\,b2\)\;
 else
 doAnd\(b2\,b1\)\;
 break\;
 \}
 display\(b1\,b2\)\;
 \}
\}

package Advanced\;

import java\.io\.BufferedReader\;
import java\.io\.InputStreamReader\;
import java\.lang\.reflect\.Method\;
import java\.security\.Permission\;

/\*Sample Input

8
Sample Output

8 is power of 2
An instance of class\: Solution\.Inner\.Private has been created
\*/
public class CanYouAccess \{
 public static void main\(String\[\] args\) throws Exception \{
 DoNotTerminate\.forbidExit\(\)\;

 try\{
 BufferedReader br \= new BufferedReader\(new InputStreamReader\(System\.in\)\)\;
 int num \= Integer\.parseInt\(br\.readLine\(\)\.trim\(\)\)\;
 Object o\;// Must be used to hold the reference of the instance of the class Solution\.Inner\.Private
 o \= \(new Inner\(\)\)\.new Private\(\)\;
 Method method \= o\.getClass\(\)\.getDeclaredMethod\("powerof2"\, int\.class\)\;
 method\.setAccessible\(true\)\;
 System\.out\.println\(num\+" is "\+method\.invoke\(o\,num\)\)\;
 System\.out\.println\("An instance of class\: " \+ o\.getClass\(\)\.getCanonicalName\(\) \+ " has been created"\)\;

\}//end of try

\ \ catch \(DoNotTerminate\.ExitTrappedException e\) \{
 System\.out\.println\("Unsuccessful Termination\!\!"\)\;
 \}
 \}//end of main
static class Inner\{
 private class Private\{
 private String powerof2\(int num\)\{
 return \(\(num\&num\-1\)\=\=0\)\?"power of 2"\:"not a power of 2"\;
 \}
 \}
\}//end of Inner

\}//end of Solution

class DoNotTerminate \{ //This class prevents exit\(0\)

 public static class ExitTrappedException extends SecurityException \{

 private static final long serialVersionUID \= 1L\;
 \}

 public static void forbidExit\(\) \{
 final SecurityManager securityManager \= new SecurityManager\(\) \{
 \@Override
 public void checkPermission\(Permission permission\) \{
 if \(permission\.getName\(\)\.contains\("exitVM"\)\) \{
 throw new ExitTrappedException\(\)\;
 \}
 \}
 \}\;
 System\.setSecurityManager\(securityManager\)\;
 \}

\}
